import styles from '../styles/BackgroundGalaxy.module.scss'
import ReactDOM from 'react-dom'
import { useRef } from 'react';
import { useEffect } from 'react';

type Point = {
  x: number;
  y: number;
  originX: number;
  originY: number;
  circle?: Circle;
  closest?: Point[];
  active?: number;
};

function BackgroundGalaxy(){
  let largeHeader = useRef(null);
  let demoCanvas = useRef(null);


  return ReactDOM.createPortal(
    <div ref={largeHeader} className={styles.largeHeader}>
      <canvas ref={demoCanvas}></canvas>
    </div>,
    document.body
  )
}

export default BackgroundGalaxy
